        public static string GetChineseEdh(string str)
        {
            if (!string.IsNullOrEmpty(str))
            {
                try
                {
                    string temp = str.Substring(0, 1);
                    int chineseIndex = chinese.IndexOf(temp);

                    if (chineseIndex >= 0)
                    {
                        return chinese.Substring(chineseIndex + 2, 1);
                    }
                }
                catch { return str; }
            }

            return str;
        }
